const Worklist = ({tasks}) => {
    return ( 
        <div >
            {tasks.map( task  => (
                <div className="work-preview">
                <h1>{ task.id +"."+task.title }</h1>
                <p>{task.body}</p>
                <div className="foot">
                <h3>{"EOD: "+task.eod}</h3>
                <button>Done</button>
                </div>
                
                </div>
            ))}
        </div>
     );
}
 
export default Worklist;
